const seedRandom = require("seedrandom");
const HDWalletProvider = require('truffle-hdwallet-provider');

require('dotenv').config();
const mnemonic = process.env.MNEMONIC;

var provider = process.env.NODE_ENV === 'development' ? new HDWalletProvider(mnemonic, `https://rinkeby.infura.io/v3/${process.env.INFURAAPIKEY}`) : 
// STILL NEED TO CHANGE THIS TO MAINNET FOR HEROKU CRONJOB
new HDWalletProvider(mnemonic, `https://rinkeby.infura.io/v3/${process.env.INFURAAPIKEY}`);

var web3 = new Web3(provider);
const payingAccount =  process.env.NODE_ENV === 'development' ? process.env.PAYER : process.env.PROD_PAYER;

// get contract instance
web3.eth.net.getId().then((id)=>{
  
  const deployedNetwork = contractJson.networks[id];
  const contract = new web3.eth.Contract(
    contractJson.abi,
    deployedNetwork.address,
  );
  // FIRST 3 DIGITS - Generate Series number
  const seriesStr = '001';

  // Generate random string to represent the new ally
  let rng = new seedRandom();
  // NEXT 11 Digits determine ally and attributes
  const num = Math.floor(rng()*100000000000);
  let strNum = num.toString();
  const uniqueBadge = '001';
  const cosmetic = '000';
  const reserveDigits = '000';
  let combinedStr = seriesStr + strNum + uniqueBadge + cosmetic + reserveDigits;

  //console.log('sender', payingAccount);

  const tt = {
    chronoGuy : '00100099966699001000000',
    compostCreature : '00110099971499001000000',
    filterBot : '00120099979199001000000',
    theEmpath : '00130099927299001000000',
    boulderBro : '00140099900499001000000',
    naturalNinja : '00150099986699001000000',
    reuseBot : '00160099909099001000000',
    timberTerror : '00170099942299001000000',
    solarSprite : '00180099953399001000000',
    wildSpeaker : '00190099934099001000000'
  };

  // Call smart contract add method to put the new ally on the blockchain
    contract.methods.addToAllyArray(web3.utils.fromAscii(combinedStr)).send({from: payingAccount, gasPrice : '4700000'})
    .on('transactionHash', (hash) => {
      console.log('HASH - ', hash);
    })
    .on('confirmation', (confirmationNumber, receipt) => {
      console.log('CONFIRM - ', confirmationNumber, receipt);
      process.exit();
    })
    .on('receipt', (receipt) => {
        // receipt example
        console.log('RECEIPT - ',receipt);
        return;
    })
    .on('error', console.error); // If there's an out of gas error the second parameter is the receipt.
    setTimeout(()=>{
      process.exit();
    },200000)
  });
